                switch (name)
                {
                    case "id":
                        base.Id = (System.Guid)value;
                        Attributes["dynamicpropertyid"] = base.Id;
                        break;
                    case "dynamicpropertyid":
                        var id = (System.Nullable<System.Guid>) value;
                        if(id == null){ continue; }
